import React from "react";

const ClearOutput = () => {
    const Email = document.getElementById('email-address');
    const Password = document.getElementById('password');

    if (Email && Password) {
        Email.value = "";
        Password.value = "";
    }
};

const LoginBtn = () => {
    // Implement login functionality here
};

const Login = () => {
    return (
        <div className="login-container">
            <main className="pa6 black-80 vh-100 w-100">
                <form className="login-form measure center">
                    <fieldset id="sign_up" className="ba b--transparent ph0 mh0">
                        <legend className="tc f1 fw6 ph0 mh0">Student Log In</legend>
                        <div className="form-group mt3">
                            <input className="form-input pa2 input-reset ba bg-transparent hover-bg-black hover-white w-100" type="email" name="email-address" id="email-address" placeholder="Email" />
                        </div>
                        <div className="form-group mv3">
                            <input className="form-input b pa2 input-reset ba bg-transparent hover-bg-black hover-white w-100" type="password" name="password" id="password" placeholder="Password" />
                        </div>
                    </fieldset>
                    <div className="form-actions">
                        <input className="login-btn f6 grow no-underline br-pill ba bw1 ph3 pv2 mb2 dib dark-blue" type="submit" value="Log In" onClick={LoginBtn} />
                        <input className="clear-btn f6 grow no-underline br-pill ba bw1 ph3 pv2 mb2 dib dark-blue" type="reset" value="Clear" onClick={ClearOutput} />
                    </div>
                    <div className="lh-copy mt3">
                        <a href="#0" className="f6 link dim black db">Forgot your password?</a>
                    </div>
                </form>
            </main>
            <footer className="footer pt4 mt3 pb0 ph3 ph5-m ph6-l bg-light-gray">
                <small className="f6 db tc">Â©<b className="ttu">Created by Group CB</b>., All Rights Reserved</small>
            </footer>
        </div>
    );
}

export default Login;
